Rhodies, click below! I promise this only takes 2 minutes tops. 

@income_movement has built a tool that will send out letters to your senators for you!  

For maximum impact, simply change a few words in the beginning to make sure the system interprets it as a unique letter.

If you're infected with the coronavirus and do not know it, a mask is essential at keeping your respiratory droplets and particles from infecting others. Wear a mask &amp; save lives. 

#KomeshaCoronaOkoaMaisha
